Test case:
input: [0, 0, 0, 5, 5, 5, 5, 0, 0]

###########################################################
Sample Outputs:
output: [0, 0, 0, 5, 0, 0, 5, 0, 0]
*/

public class Solution {
    public int[] solution(int []arr) {
        int count = 0;
        for (int i=0;i<arr.length-1;i++) {
            if (arr[i] == arr[i+1]) {
                count++;
            } else {
                arr[i - count] = arr[i];
            }
        }
        return Arrays.copyOfRange(arr, 0, arr.length - count);
    }
}
